        <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarTogglerDemo02" aria-controls="navbarTogglerDemo02" aria-expanded="false" aria-label="Toggle navigation">
        <span class="navbar-toggler-icon"></span>
        </button> */}

        <div class="collapse navbar-collapse" id="navbarTogglerDemo02">
          <ul class="navbar-nav mr-auto mt-5 mt-lg-0">
            <li class="nav-item pl-3 pr-3">
            <a class="nav-link font-custom" href="#">Home<span class="sr-only">(current)</span></a>
            </li>
            <li class="nav-item pl-3 pr-3">
            <a class="nav-link font-custom" href="https://google.com">New Reelase</a>
            </li>
            <li class="nav-item pl-3 pr-3">
            <a class="nav-link font-custom" href="#">Popular</a>
            </li>
            <li class="nav-item pl-3 pr-3">
            <a class="nav-link font-custom" href="#">Article</a>
            </li>
            <li class="nav-item pl-3 pr-3">
            <a class="nav-link font-custom" href="#">Manga List</a>
            </li>
          </ul>

          <form class="form-inline my-2 my-lg-0">
            <input class="form-control mr-sm-2" type="search" placeholder="Search" onSubmit={this.helloWorld}/>
            <span className="input-group-text border-0" id="search-addon">
            </span>
            {/* <button class="btn btn-outline-success my-2 my-sm-0" type="submit">Search</button> */}
          </form>

        </div>
      </nav>
    </div>
    )
  }
